import React from "react";

const FilterBox = ({ filterID }) => {
  return (
    <React.Fragment>
      <div>
        <label>
          {" "}
          {filterID}
          <input type="checkbox" id={filterID} />
        </label>
      </div>
    </React.Fragment>
  );
};

export default FilterBox;
